The Agent has the right to seek indemnification and be free from harm caused by the Company, its officers, directors, agents, representatives, affiliates, or any other entity controlling them (collectively referred to as the "Company Indemnitees"), with respect to any losses, claims, damages, liabilities, and expenses (including investigation costs and attorney fees) incurred due to:

1. The actions of the Agent or its associates that display good faith or ordinary carelessness on their part;
2. Compliance with applicable federal or state laws or regulations by the Agent or its associates;
3. Adherence to the terms, representations, or warranties outlined in this Agreement by the Agent or its associates.

The Company will compensate the Agent and the Company Indemnitees for any legal or other costs reasonably spent in investigating or defending against such losses, claims, damages, liabilities, or actions. However, the Company shall not be obligated to cover:

1. Any losses, claims, damages, liabilities, or expenses resulting from good faith or ordinary carelessness on the part of the Agent or its associates;
2. Losses, claims, damages, liabilities, or expenses stemming from actions or conduct by the Agent or its associates that violate any applicable federal or state laws or regulations;
3. Losses, claims, damages, liabilities, or expenses caused by actions or conduct of the Agent or its associates that breach any of the Company's agreements, representations, or warranties outlined in this Agreement.
